import axiosClient from "./axiosClient";

export const historyApi = {
    getListHistory: () => {
        const url = "/histories/all";
        return axiosClient.get(url);
    },
    getListHistoryDetailById: (id:string) => {
        const url = `/histories/${id}/all`;
        return axiosClient.get(url);
    },
};
